import React from 'react'
import products from "../products.json"

export default function Products() {
    return (
      <>
        {products.map((product,index) => (
            <div key={index}>
                <img src={product.image} alt={product.title} />
                <h3>{product.title}</h3>
                <p>{product.price} TL</p>
                <button>Sepete Ekle</button>
            </div>
        ))}
      </>
  )
}
